import React, {Component} from 'react';
import './css/Tasks.css';

class Tasks extends Component {
  constructor(props) {
    super(props);
    this.state = {
      test: 12,
    }
  }

  render() {
    return (
      <h1>{this.state.test}</h1>
    )
  }
}

export default Tasks;
